    <div>
      <h1>Login</h1>
      <input
        onChange={(e) => setEmail(e.value)}
        type="email"
        className="ds-form-input"
      />
      <input
        onChange={(e) => password(e.value)}
        type="password"
        className="ds-form-input"
      />
      <button>Login</button>
    </div>
  );
};

export default LoginPage;
